import Link from "next/link";
import Page from "../layouts/Page";

const Index = () => (
    <Page>
        <section className="content" ref="home">
            <h1>Hi, I'm Orion.</h1>
            <p className="home-description">
                I study Finance and Data Science at NYU, with a minor in
                Computer Science.
            </p>
        </section>
        <section className="" />
    </Page>
);

export default Index;
